import React, { useState } from "react";
// import "./index.css";

const F2 = ()  =>{
const [name,setName] = useState({
    fname : "",
    lname : "",
    email: "",
    phone : ""
})

const Enter = (event) =>{

const val = (event.target.name);
console.log(val);
setName({
    val : event.target.value,
})

}
 const submit = (event) =>{
event.preventDefault();
alert("Form Submitted");

}


return(
<>
<h2>
    These the Form In React .
</h2>
<div className="main">
    <div className="first">


<form onSubmit={submit}>
    <input type = "text" placeholder="Enter Name " name = "fname" value={name.fname} onChange={Enter} className="abc"/>
    <br/>
    <br></br>
    <input type = "text" placeholder="Enter password"  name = "lname" value={name.lname} onChange={Enter} className="abc"/>
    <br></br>
    <br></br>
    <input type = "text" placeholder="Enter Email"  name = "email" value={name.email} onChange={Enter} className="abc"/>
    <br></br>
    <br></br>
    <input type = "number" placeholder="Enter your Number"  name = "phone" value={name.phone} onChange={Enter} className="abc"/>
    <br></br>
    <br></br>
    <button > Submit</button>
    
    
</form>

    </div>
</div>
</>
)

    
}


export default F2;
